import React from "react";
import './Home.css';

const Home = () => {
    return (
        <div className="home-container">
            <h1>Welcome to LangChain ChatGPT App</h1>
            <p>This is your home page. Customize this content as needed.</p>
            <h3>  OR  </h3>
      <input accept="image/*" id="icon-button-file"
        type="file" style={{ display: 'none' }} />
      <label htmlFor="icon-button-file">
        <IconButton color="primary" aria-label="upload picture"
        component="span">
          <PhotoCamera />
        </IconButton>
      </label>
        </div>

    );
};

export default Home;
